    <style>
        body {
            margin: 0;

            text-align: left;
            box-sizing: border-box;

        }

            html, body { background: white; }
            section { margin: 0 auto; }
        }

        p {
            margin:0;
            padding: 0;
            position: relative;
        }

        p span, p .img, p .gfx {
           position: absolute;
        }

        span {
            display: block;
            vertical-align: text-bottom;
        }

        .b{ font-weight: bold; }
        .i{ font-style: italic; }
        .u{ text-decoration: underline; }
        .s{ text-decoration: line-through; }
        .in{ background: black; color: white; }
        .s, .sd{ text-decoration: line-through; }

        .upd { transform: scale(1, -1); }

        .str { transform-origin: top left; }

        .w7{ transform: scaleX(7); }
        .h7{ transform: scaleY(7); }

        .w8{ transform: scaleX(8); }
        .h8{ transform: scaleY(8); }
        .w8.h8{ transform: scale(8); }

        img { display: block; }
    </style>
